css:
.gutter[gutter-name=nuclide-diagnostics-gutter] {
  min-width: 0.5em;
}
.nuclide-diagnostics-gutter-ui-gutter-error,
.nuclide-diagnostics-gutter-ui-gutter-warning {
  text-align: left;
  display: block;
  width: 0.8em;
  color: #6494ed;
  transform: scale(0.7);
  transform-origin: left;
}
.nuclide-diagnostics-gutter-ui-gutter-error::before,
.nuclide-diagnostics-gutter-ui-gutter-warning::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 130%;
  width: 130%;
  height: 130%;
  content: "\f05a";
}
.nuclide-diagnostics-gutter-ui-gutter-error {
  color: #ff6347;
}
.nuclide-diagnostics-gutter-ui-gutter-warning {
  color: #e2c08d;
}
.nuclide-diagnostics-gutter-ui-popup {
  background: #21252b;
  box-shadow: 0px 1px 4px 0px #000000;
  position: absolute;
  padding-right: 10px;
  padding-left: 10px;
  z-index: 4;
}
.nuclide-diagnostics-gutter-ui-popup-header {
  display: flex;
  justify-content: space-between;
  margin-left: -10px;
  margin-right: -10px;
  padding: 4px 10px;
}
.nuclide-diagnostics-gutter-ui-popup-diagnostic {
  color: #9da5b4;
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
}
.nuclide-diagnostics-gutter-ui-popup-error .nuclide-diagnostics-gutter-ui-popup-header {
  background-color: rgba(255, 99, 71, 0.2);
}
.nuclide-diagnostics-gutter-ui-popup-warning .nuclide-diagnostics-gutter-ui-popup-header {
  background-color: rgba(226, 192, 141, 0.2);
}
.nuclide-diagnostics-gutter-ui-popup-message {
  padding-top: 4px;
  padding-bottom: 4px;
}
